import React from 'react';
import ReactDOM from 'react-dom';


function Page(){
    return(
        <div>
            <ol>
                <li>
                    hel
                </li>
                <li>
                    del
                </li>
                <li>
                    sel
                </li>
            </ol>
        </div>
    )
}


ReactDOM.render(<Page />, document.getElementById("root"))
